function NatureCards(data) {

    return (
        <>
            <div className="container">
                <div className="row">

                    {
                        data.map((item) => {
                            return(
                            <>
                                <div className="container">
                                    <div className="row">
                                        <div className="col-md-4">
                                            <div className="card" style={{ width: "18rem" }}>
                                                <div className="card-header">{item.name} <span id="badge">{item.id}</span></div>
                                                <img className="card-img-top" src={item.imgage} alt="Card image cap" />
                                                <div className="card-body">
                                                    <h5>Description</h5>
                                                    <p className="card-text">{item.description}</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </>
                            )

                        })
                    }




                </div>
            </div>

        </>

    )
}
export default NatureCards;
